import React, { FC } from "react";
import { currentTime } from "../../utils";
import style from "./index.module.scss";

const Home: FC = () => {
  const { time, date, day } = currentTime();
  return (
    <div className={style.lock_container}>
      <div className={style.lock_screen}>
        <div className={style.lock_title}>
          <h1>{time}</h1>
          <h2>{date}</h2>
          <h3>{day}</h3>
        </div>
        <div className={style.lock_card}>
          <div className={style.card_header}>
            <div>
              <img src="" alt="" srcSet=""/>
              <span>人民入保放假客服 </span>
            </div>
            <span>刚刚</span>
          </div>
          <p>鹤骨鸡肤开放后即可噶科技股份可高科技福建客户鼓风机好尬接口规范换个积分卡嘎咖啡机好机会厂家发货款</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
